import React, { useState } from 'react'

function InputForm() {
   const [name,setName] = useState('');

    const changeValue = (e) => {
      setName(e.target.value)
      console.log(name);
    }
  return (
    <div>
        <form>
             <input name="text" value={name} onChange={changeValue} />
             <p>{e.target.value}</p>
        </form>
    </div>
  )
}

export default InputForm;
